import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

import { UserRouteAccessService } from 'app/core/auth/user-route-access.service';
import { ProtectedPayableComponent } from 'app/payment/protected-payable/protected-payable.component';
import {
  ProtectedPayableApprovalComponent
} from 'app/payment/protected-payable/protected-payable-approval/protected-payable-approval.component';
import {
  ProtectedPayableEditRejectedComponent
} from 'app/payment/protected-payable/protected-payable-edit-rejected/protected-payable-edit-rejected.component';

const routes: Routes = [
  {
    path: '',
    component: ProtectedPayableComponent,
    data: {
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'approve/:protectedPayableId',
    component: ProtectedPayableApprovalComponent,
    data: {
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'terminate/approve/:protectedPayableId',
    component: ProtectedPayableApprovalComponent,
    data: {
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'rejected/edit/:protectedPayableId',
    component: ProtectedPayableEditRejectedComponent,
    data: {
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  }
];


@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})


export class ProtectedPayableRoutingModule {
}
